import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@material-ui/core';
import axios from 'axios';
import React, { useEffect, useState } from 'react';

const DataTable = () => {
    const {api} =window['runtime-config']
    let [questions,setQuestions]=useState([]);
    let [isDataFecteched , setisDataFeteched]=useState(true)
 useEffect(()=>{
    setisDataFeteched(true)
    fetchingData()
    setisDataFeteched(false)
 },[])
  const fetchingData = async()=>{
    try {
        const record=await axios.get(api);
        setQuestions(record.data)
    }
    catch(error)
    {
        console.log(error);
    }
  }

    return isDataFecteched?"Fetching Data" :  ( 
      <TableContainer>
          <Table>
              <TableHead>
                  <TableRow>
                      <TableCell>ID</TableCell>
                      <TableCell>ENGLISH</TableCell>
                      <TableCell>TYPE</TableCell>
                      <TableCell>LEVEL</TableCell>
                      <TableCell>ACTION</TableCell>
                  </TableRow>
              </TableHead>
              <TableBody>

                   {questions.map(q=>
                   <TableRow>
                     <TableCell>{q.id}</TableCell>
                     <TableCell>{q.statement_en}</TableCell>
                     <TableCell>{q.type}</TableCell>
                     <TableCell>{q.level}</TableCell>
                     </TableRow>
                    )}


              </TableBody>
          </Table>
      </TableContainer>
     );
}

export default DataTable;
